<p>However, in the document schema, I do not have any field set to unique:</p>
<pre><code>const orderSchema = new Schema({
    paymentId: {
        type: Number
    },
    paymentStatus: {
        type: String
    },
    paymentToken: {
        type: String
    },
    orderDetails: {
        type: Object
    },
}, {
    timestamps: true
});
</code></pre>
<p>What does the error mean?
I am saving it like this:</p>
<pre><code>const newOrder = new Order({
        paymentId, 
        paymentStatus, 
        orderDetails,
        paymentToken
    });

    newOrder.save()
