<p>and <code>Products</code>:</p>
<pre><code>/* 1 */
{
    &quot;_id&quot; : ObjectId(&quot;6044ad6673d61b6452d463bd&quot;),
    &quot;name&quot; : &quot;Product 1&quot;,
    &quot;categoryId&quot; : &quot;6044ad2973d61b6452d46391&quot;
}

/* 2 */
{
    &quot;_id&quot; : ObjectId(&quot;6044ad8173d61b6452d463c6&quot;),
    &quot;name&quot; : &quot;Product 2&quot;,
    &quot;categoryId&quot; : &quot;6044ad2973d61b6452d46391&quot;
}
</code></pre>
<p>On the local PC I have got the latest version of <code>MongoDB</code> installed (<code>&gt;4.4</code>), that why to embed documents from <code>Products</code> collection to <code>Categories</code> I need to write a quite trivial and simple script:</p>
<pre><code>db.getCollection('categories').aggregate([

{$match: {}}, 

{$addFields:{
    idStr: {$toString: &quot;$_id&quot;}
    }},

    {
        $lookup: {
             from: &quot;products&quot;,
             localField: &quot;idStr&quot;,
             foreignField: &quot;categoryId&quot;,
             as: &quot;products&quot;
            }
        },

        {$project:{
            idStr: 0}},

            {$merge:
                {
                    into: &quot;categories&quot;,
                    on:&quot;_id&quot; 
                    }}
