Stream large response in Micronaut controller without going out of memory<p>We're using Micronaut with Mongo to expose data through some controllers. Because the size of the response entities is growing, our apps go out of memory sometimes. So we’re investigating switching to the async mongo driver and using reactive responses to stream the data to clients. Unfortunately we can’t change API response structures nor content types (all <code>application/json</code>)</p>
<p>One of our APIs returned entities structured like this:</p>
<pre><code>[
  { &quot;field&quot;: &quot;value&quot; },
  { &quot;field&quot;: &quot;value&quot; },
  ...
  { &quot;field&quot;: &quot;value&quot; }
]
</code></pre>
<p>This we got working using this controller, where the <code>dataStore</code> returns a <code>Publisher&lt;Example&gt;</code>:</p>
<pre><code>    @Get(&quot;all&quot;)
    Flowable&lt;Example&gt; getAllExamples() {
        return Flowable.fromPublisher(dataStore.find()).map(SomeMapper::toPublic);
    }
</code></pre>
<p>This works nicely, the huge list of examples doesn’t have to be fully loaded into memory before streaming it out to the client.</p>
<p>Other APIs return the (imo more sensible) structure:</p>
<pre><code>{
  &quot;list&quot;: [
    { &quot;field&quot;: &quot;value&quot; },
    { &quot;field&quot;: &quot;value&quot; },
    ...
    { &quot;field&quot;: &quot;value&quot; }
  ],
  &quot;meta&quot;: {
    ...
  }
}
</code></pre>
<p>Can we apply a similar publisher/flowable pattern for entities like this, or are stuck loading data for such responses into memory before sending them out?</p>
<p>We tried signatures like:</p>
<pre><code>    @Get(&quot;all/dev&quot;)
    Single&lt;ExamplesWrapper&gt; getAllDev() {
        Publisher&lt;Example&gt; dev = dataStore.find();
        return Flowable.fromPublisher(dev)
                .map(mapper::map)
                .collect((Callable&lt;ArrayList&lt;Example&gt;&gt;) ArrayList::new, ArrayList::add)
                .map(ExampleWrapper::new);
    }
</code></pre>
<p>Where the wrapper would add some metadata. But this again loads it all into memory before sending it out, crashing the app.</p>
<p>Adding the Flowable into the response wrapper:</p>
<pre><code>
public class ExamplesWrapper {

    private final Flowable&lt;Example&gt; examples;

    @ConstructorProperties({&quot;examples&quot;})
    public ExamplesWrapper(Flowable&lt;Example&gt; examples) {
        this.examples = examples;
    }

    public Flowable&lt;Example&gt; getExamples() {
        return examples;
    }
}
</code></pre>
<p>Also fails with some nice Jackson mapping exception.</p>
<p>Metadata is not dependent on the actual example data (it adds some static company info). Can we somehow implement such an endpoint without having to load all data into memory?</p>

